  signal ADD_clk : std_logic_vector(11 downto 0);
  signal WEN_clk : std_logic;

  signal mem : INIT16KX32_TYPE := INIT;

begin

  xilinx_gen : if CORE_TECH = xilinx generate
    WEN <= we(0) or ce;
    ADD <= std_logic_vector(address(13 downto 2));

    xilinx_rom: process (clk)
    begin
      if falling_edge(clk) then
        if WEN = '0' then
          mem(to_integer(unsigned(ADD))) <= to_bitvector(d);
        end if;
        ADD_clk <= ADD;
      end if;
    end process;
    q <= to_stdlogicvector(mem(to_integer(unsigned(ADD_clk)))); 
  end generate;

end architecture;
